import React from 'react';
import './ClientLogos.css';
// Import placeholder logos
import Logo1 from '../../assets/logos/client-logos/logo1.png';
import Logo2 from '../../assets/logos/client-logos/logo2.png';
import Logo3 from '../../assets/logos/client-logos/logo3.png';
import Logo4 from '../../assets/logos/client-logos/logo4.png';
import Logo5 from '../../assets/logos/client-logos/logo5.png';
import Logo6 from '../../assets/logos/client-logos/logo6.png';

const ClientLogos = () => {
  // These would be replaced with actual client logos
  const logos = [
    { id: 1, src: Logo1, alt: 'Client 1' },
    { id: 2, src: Logo2, alt: 'Client 2' },
    { id: 3, src: Logo3, alt: 'Client 3' },
    { id: 4, src: Logo4, alt: 'Client 4' },
    { id: 5, src: Logo5, alt: 'Client 5' },
    { id: 6, src: Logo6, alt: 'Client 6' },
  ];

  return (
    <div className="client-logos">
      {logos.map(logo => (
        <div key={logo.id} className="logo-item">
          <img src={logo.src} alt={logo.alt} />
        </div>
      ))}
    </div>
  );
};

export default ClientLogos;
